@siteptbr Juro queria MUITO saber o q elas usam, pq eu usei saxenda por quase 1 ano, ozempic por 6 meses, wegovy por 2 meses,  ate monjauro ja tentei e nada disso emagrece.
Ele tira sua fome? Sim.
Mas eu nao como hamburguer pq to com fome, como pq é bom. Se fosse fome comia salada 🥲🥲

@CTVNews Canada approves Ozempic?

Come on guys tell the truth

Ozempic and Wegovy are different brand names for the same injectable drug,

@Rewkang Do we really need DeSci funding for GLP-1 agonists tho. 
That mfer market earns $44.5Bn in 2023, and already in GEN3 product clinical trial, Semaglutide used @GLP1science is the 2nd gen old stuff (approved already in 2019, Rybelsus,Ozempic and Wegovy).

So....imo they prob don't

@Patri_ov @Jenny_ynadamas Jenny, tu caso es claro, y me alegra que te puedan operar pronto.
Lo único que quiero aportar es que a mi madre de 63 años que acaba de pasar la menopausia le han recetado wegovy para bajar literalmente 5 kilos. Y eso es una barbaridad.
Suerte con tu operación ❤️
